import  ListGroup  from "react-bootstrap/ListGroup";
import { ListGroupItem } from "react-bootstrap";

const TodoItem = (props) =>{
    return(
        <ListGroupItem>
                <ListGroup.Item>{props.item.text}</ListGroup.Item>

        </ListGroupItem>
        );
};
export default TodoItem;
